				if ($count -gt 1)
				{
					<#if (!!$ShotcutInfo.LinkInfo.LocalBasePath -and $lpath[0].length -gt (Split-Path -Path $ShotcutInfo.LinkInfo.LocalBasePath -Qualifier).Length)
					{ $target = Split-Path -Path $ShotcutInfo.LinkInfo.LocalBasePath -Qualifier }#>
